import React from 'react';

import Sections from './Components/Sections';
import Main from './Components/Main';
import { observer } from 'mobx-react';
import './App.css';

class App extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div>
        <Sections store={this.props.store}/>
        <Main />
      </div>
    );
  }
}

export default App;
